import React from "react";

// https://opentdb.com/api.php?amount=6&category=18&difficulty=easy
export default function Quiz(props) {
    const [questions, setQuestions] = React.useState([])

    const res = fetch("https://opentdb.com/api.php?amount=6&category=18&difficulty=easy&type=multiple")
        .then(res => res.json())
        .then(data => setQuestions([{value:"a"}]))

    return (
        <p>{questions[0].value}</p>
    )
}
